import React, { FormEvent } from 'react'
import { useFormStatus } from 'react-dom'
import Form from 'react-bootstrap/Form'

function SubmitButton() {

}

export const CreateUser = () => {

	const onSubmit = (e: React.FormEvent<HTMLFormElement>) => {
		e.preventDefault();

		const username = (e.currentTarget.elements.namedItem("username") as HTMLInputElement).value;
		const email = (e.currentTarget.elements.namedItem("email") as HTMLInputElement).value;
		const password = (e.currentTarget.elements.namedItem("password") as HTMLInputElement).value;

		async function fetchData(username: string, email: string, password: string) {
			try {
				const response = await fetch(
					"http://localhost:8080/users/",
					{
						method: "POST",
						body: JSON.stringify({
							"username": username,
							"email": email,
							"password": password,
						})
					},
				);

				if (!response.ok) {
					throw new Error(await response.text())
				}

				const user = await response.json();

				console.log("User created: ", user);
			} catch (error) {
				console.error(error);
			}
		}

		fetchData(username, email, password);
	}

	return (
		<div className='user-create'>
			<form onSubmit={onSubmit} className='user-create-form'>
				<Form.Group className='user-createform-group'>
					<Form.Label>Name</Form.Label>
					<Form.Control type='text' name="username" placeholder='enter your username' />
				</Form.Group>
				<Form.Group>
					<Form.Label>Email</Form.Label>
					<Form.Control type='text' name="email" placeholder='enter your email' />
				</Form.Group>
				<Form.Group>
					<Form.Label>Password</Form.Label>
					<Form.Control type='text' name="password" placeholder='enter your password' />
				</Form.Group>
				<button type="submit">Submit</button>
			</form>
		</div>
	)
}
